import { Text, View } from 'react-native'
import React from 'react'
import Icon from 'react-native-vector-icons/FontAwesome';

export default function Tab_navigator() {
 
    return(
        
          <View style={styles.NavContainer}>
              <View style={styles.NavBar}>
                 
              <Icon name="whatsapp" size={10} color="#900" style={styles.icones}/>
              <Icon name="facebook" size={10} color="#900"  style={styles.icones}/>
              <Icon name="instagram" size={10} color="#900"  style={styles.icones}/>
                
              </View>
          </View>
        
    )
}

const styles = StyleSheet.create({

    container: {

        flex: 1, 
        backgroundColor: '#3962ff',
        alignItems: 'center',
        justifyContent: 'center',

    },

    NavContainer:{
       
        position: 'absolute',
        alignItems:'center',
        bottom:'20',

    },

    NavBar:{

        flexDirection:'row',
        backgroundColor:'#eee',
        width: '90%',
        justifyContent:'space-evenly',
        borderRadius: 40,

    },

    IconBehave: {

        padding: 14,

    },
});
